import React from 'react';

interface TestCase {
  description: string;
  method: string;
  url: string;
  body: any;
  expectedStatus: number;
}

interface TestCasesListProps {
  testCases: TestCase[];
  onRunTests: () => void;
  runningTests: boolean;
}

const TestCasesList: React.FC<TestCasesListProps> = ({
  testCases,
  onRunTests,
  runningTests,
}) => {
  return (
    <div>
      <h2>Generated Test Cases</h2>
      <button onClick={onRunTests} disabled={runningTests || testCases.length === 0}>
        {runningTests ? 'Running...' : 'Run Tests'}
      </button>
      <table>
        <thead>
          <tr>
            <th>Description</th>
            <th>Method</th>
            <th>URL</th>
            <th>Body</th>
            <th>Expected Status</th>
          </tr>
        </thead>
        <tbody>
          {testCases.map((testCase, index) => (
            <tr key={index}>
              <td>{testCase.description}</td>
              <td>{testCase.method}</td>
              <td>{testCase.url}</td>
              <td>
                <pre>
                  <code>{JSON.stringify(testCase.body, null, 2)}</code>
                </pre>
              </td>
              <td>{testCase.expectedStatus}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TestCasesList;
